import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with domcontentloaded instead of networkidle
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to be visible
    await page.waitForSelector('.product-card', { timeout: 10000 });

    // Click on the first product card to open modal
    await page.click('.product-card:first-child');

    // Wait for product modal to appear
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 10000 });

    // Wait for product detail content to load
    await page.waitForSelector('.product-detail-title', { timeout: 10000 });

    // Take screenshot of the modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract product details from modal
    const productTitle = await page.$eval('.product-detail-title', el => el.textContent.trim());
    const productPrice = await page.$eval('.product-detail-price', el => el.textContent.trim());
    const productRating = await page.$eval('.product-detail-rating .stars', el => el.textContent.trim());

    return {
      success: true,
      action: "Opened product detail modal and extracted product information",
      extractedData: {
        title: productTitle,
        price: productPrice,
        rating: productRating
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
